DROP TABLE IF EXISTS `data_training`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `data_training` (
  `id` int NOT NULL AUTO_INCREMENT,
  `nik` varchar(16) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `nama` varchar(100) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `jenis_kelamin` enum('laki-laki','perempuan') COLLATE utf8mb4_general_ci DEFAULT NULL,
  `pendidikan_terakhir` enum('SD','SLTP','SLTA') COLLATE utf8mb4_general_ci DEFAULT NULL,
  `pekerjaan` enum('Tani','Pedagang','Buruh') COLLATE utf8mb4_general_ci DEFAULT NULL,
  `aset_bergerak` enum('Ada','Tidak ada') COLLATE utf8mb4_general_ci DEFAULT NULL,
  `rt` varchar(3) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `rw` varchar(3) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `tempat_tinggal` enum('lainnya','bebas sewa','milik sendiri','kontrakan') COLLATE utf8mb4_general_ci DEFAULT NULL,
  `dinding` enum('anyaman bambu','kayu','tembok') COLLATE utf8mb4_general_ci DEFAULT NULL,
  `lantai` enum('kayu','semen/bata merah','ubin','keramik') COLLATE utf8mb4_general_ci DEFAULT NULL,
  `atap` enum('seng','anyaman bambu','anyaman') COLLATE utf8mb4_general_ci DEFAULT NULL,
  `sumber_air_minum` enum('Sumur Bor/Pompa','Sumur Terlindung','Air Isi Ulang') COLLATE utf8mb4_general_ci NOT NULL,
  `sumber_air` enum('Air Sungai','PAM') COLLATE utf8mb4_general_ci DEFAULT NULL,
  `sumber_penerangan` enum('Bukan Listrik (Tanpa Meteran)','Listrik PLN (Tanpa Meteran)','Listrik Non PLN (450 Watt)','Listrik PLN (450 Watt)','Listrik PLN (900 Watt)') COLLATE utf8mb4_general_ci DEFAULT NULL,
  `bahan_bakar_masak` enum('Gas 3Kg','Listrik') COLLATE utf8mb4_general_ci DEFAULT NULL,
  `tempat_bab` enum('Umum','Sendiri') COLLATE utf8mb4_general_ci DEFAULT NULL,
  `jenis_kloset` enum('Tidak Pakai','Cemplung/Cubluk','Leher Angsa') COLLATE utf8mb4_general_ci NOT NULL,
  `keterangan` enum('Miskin','Tidak Miskin') COLLATE utf8mb4_general_ci DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=505 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
